import axios from 'axios';
const url = "https://covid19.mathdro.id/api";
export const fetchData = async() => {
    try {
        const {response:{confirmed,recovered,deaths,lastUpdate}} = await axios.get(url);
        const modified_data={
            confirmed,
            recovered,
            deaths,
            lastUpdate,
        }
        return modified_data;
    } 
    catch (error) {

    }
}
